                            link.textContent = item[key];
                            link.target = "_blank"; // Abre o link em uma nova aba
                            
                            // Adiciona o link correto com base no valor de "Remota ERCP"
                            switch (item[key]) {
                                case "1411ERCP1A":
                                    link.href = "https://drive.google.com/uc?export=download&id=1HNYGkXq31RIX_c3SXLklOCS0QdqYXRgh";
                                    break;
                                case "1411ERCP1B":
                                    link.href = "https://drive.google.com/uc?export=download&id=1kX7s7f6pisKINSp0q3V5kHAFSm3MtKII";
                                    break;
                                case "1411ERCP1C":
                                    link.href = "https://drive.google.com/uc?export=download&id=1_GTfihjQ9S9x9vBh952GdjVO1mN9Y2nA";
                                    break;
                                case "1411ERCP1D":
                                    link.href = "https://drive.google.com/uc?export=download&id=1a8qGxdCTZunuhgx5x2p1YYGU0XMNMVBz";
                                    break;
                                case "1411ERCP1E":
                                    link.href = "https://drive.google.com/uc?export=download&id=1MQh3Un4OOEHh5UzvTpbjhJbU6-gM3m5q";
                                    break;
                                case "1411ERCP1F":
                                    link.href = "https://drive.google.com/uc?export=download&id=189VNhfLWNnhIJvQz2oCzbn_bZpoEIYHo";
                                    break;
                                default:
                                    link.href = "#"; // Caso não corresponda, não faz nada
                                    break;
                            }

                            // Adiciona o link à célula
                            cell.appendChild(link);
                        } else {
                            // Para outras colunas, apenas insere o texto
                            cell.textContent = item[key];
                        }
                        
                        // Adiciona a célula à linha
                        row.appendChild(cell);
                    }
                    
                    // Adiciona a linha à tabela
                    dataTable.appendChild(row);
                });
            }

            // Função para filtrar os dados com base na busca
            function filterData(query) {
                const lowerQuery = query.toLowerCase();
                return data.filter(item => {
                    return Object.values(item).some(value => value.toLowerCase().includes(lowerQuery));
                });
            }

            // Função de busca
            function performSearch() {
                const query = searchInput.value.trim(); // Remove espaços em branco
                if (query === "") {
                    renderTable(data); // Se a consulta estiver vazia, exibe todos os dados
                } else {
                    const filteredData = filterData(query);
                    renderTable(filteredData);
                }
            }

            // Adiciona o evento de input para fazer a busca enquanto digita
            searchInput.addEventListener('input', performSearch);

            // Renderiza a tabela com todos os dados inicialmente
            renderTable(data);
        });
    </script>
</body>
</html>
